def homework3():
    arr = npy.reshape(npy.arange(25), (5, 5))
    tmp = arr[:2, :2]
    arr[:2, :2] = npy.random.rand(tmp.shape[0], tmp.shape[1]) * 100
    print(arr)

    arr1 = npy.random.randn(1, 10)
    print(arr1)


def lemonadeChange(bills: List[int]) -> bool:
    if bills[0] != 5:
        return False
    Fnum = 0
    Tnum = 0
    for bill in bills:
        if bill == 5:
            Fnum += 1
        elif bill == 10:
            Fnum -= 1
            if Fnum < 0:
                return False
            Tnum += 1
        else:
            if Tnum == 0:
                Fnum -= 3
                if Fnum < 0:
                    return False
            else:
                Tnum -= 1
                Fnum -= 1
                if Fnum < 0:
                    return False
    return True


